import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";

function Expenses(props) {
  const data = ExpensesData.map((data) => {
    return (
      <div>
        <ExpenseItem
          key={data.id}
          title={data.title}
          amount={data.amount}
          date={data.date}
        />
      </div>
    );
  });

  return <div className="expenses">{props.data}</div>;
}

export default Expenses;
